    @Test
    public void isAnagram() {
        System.out.println(isAnagram("a"
                ,"b"));

        System.out.println(isAnagram(""
                ,""));
    }
    
    public boolean isAnagram(String s, String t) {
        HashMap<Character,Integer> map = new HashMap();
        HashMap<Character,Integer> map2 = new HashMap();
        if(s.length()!=t.length())
            return false;

        for (int i = 0; i < t.length(); i++) {
            if(!map.containsKey(s.charAt(i)))
                map.put(s.charAt(i),0);
            else
                map.put(s.charAt(i),map.get(s.charAt(i))+1);

            if(!map2.containsKey(t.charAt(i)))
                map2.putIfAbsent(t.charAt(i),0);
            else
                map2.put(t.charAt(i),map2.get(t.charAt(i))+1);
        }

        for (Map.Entry<Character, Integer> entry :
             map.entrySet()) {

            if(map2.get(entry.getKey())==null || map2.get(entry.getKey()).intValue()!=entry.getValue().intValue()) {
                System.out.println(entry.getKey()+" "+entry.getValue()+" "+map2.get(entry.getKey()));
                return false;
            }

        }

       // System.out.println(s);
        return true;
    }
