    public int[] twoSum(int[] numbers, int target) {

        int[] res = new int[2];
        int j=numbers.length-1;
        int i=0;
        while(i!=j) {

            System.out.println(i+" "+ j+" "+numbers[j]+" "+numbers[i]);
            if(numbers[j]+numbers[i] == target){
                res[0]=i+1;
                res[1]=j+1;
                break;
            }

            if(numbers[j]+numbers[i] > target){
                j--;
            }else{
                i++;
            }
        }
        System.out.println(IntStream.of(res).boxed().collect(Collectors.toList()));
        return res;
    }

    public static final  void swap (int[] a, int i, int j) {
        int t = a[i];
        a[i] = a[j];
        a[j] = t;
    }

    @Test
    public void removeDuplicates() {
        System.out.println(removeDuplicates(new int[]{1}));
        System.out.println(removeDuplicates(new int[]{1,1,2,2}));
        System.out.println(removeDuplicates(new int[]{1,1,2,3,3,4,350,351}));
    }
    public int removeDuplicates(int[] nums) {
        int j=0;
        for (int i = 0; i < nums.length-1; i++) {
            if(nums[j] != nums[i+1]){
                swap(nums,++j,i+1);
            }
        }
        return j+1;
    }
